import React, { useState } from 'react';

function Doctordashboard() {
  const [activeComponent, setActiveComponent] = useState(''); // Tracks the active section

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <button onClick={() => setActiveComponent('profile')}>Create Profile</button>
        {/* Add other sidebar buttons */}
      </div>

      <div className="main-content">
        {activeComponent === 'profile' && <DoctorProfile />}
        {/* Add conditional rendering for other components */}
      </div>
    </div>
  );
}

export default Doctordashboard;
